import leaflet from "leaflet";

const defaultMarker = new leaflet.icon({
  iconUrl: "https://unpkg.com/leaflet@1.4.0/dist/images/marker-icon.png",
  iconSize: [25, 41],
  iconAnchor: [13, 0]
});

export { defaultMarker };
